import React, { Component } from 'react'
import SearchButton from "./../components/searchButton"

class ScheduleMedicalAppoinment extends Component {
    state = {
        patientIdentity: ''
    }
    //se instalo npm install material-design-icons react-bootstrap bootstrap
    handleChangeCollapse = () => {
        this.setState({
            open: !this.state.open
        })
    }

    render() {
        const { patientId } = this.state
        return (
            <div>
                <label>Enter patient identity:</label>
                <SearchButton patientId={patientId} />
            </div>
        )
    }
}
export default ScheduleMedicalAppoinment;
